import React, { useState } from "react";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import ListItemText from "@mui/material/ListItemText";
import IconButton from "@mui/material/IconButton";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";

import CloseIcon from "@mui/icons-material/Close";
import RadioButtonUncheckedIcon from "@mui/icons-material/RadioButtonUnchecked";
import TaskAltIcon from "@mui/icons-material/TaskAlt";
import { Container } from "@mui/material";

import theme from "../../styles/theme";

import AlarmList from "./AlarmList";

const AlarmItem = () => {
  const alarmTypes = ["갈망포카", "채팅알람", "갈망포가"];
  const alarmTexts = [
    "지금 당신의 갈망포카가 올라왔어요! 확인해보세요.",
    "{} 님이 채팅을 보냈습니다.",
    "지금 당신의 갈망포카가 올라왔어요! 확인해보세요.",
  ];
  const alarmTimes = [
    "2024-01-23 19:24",
    "2024-01-23 19:34",
    "2024-01-23 19:54",
  ];

  return (
    <div>
      {/* <AlarmList readList={} setReadList={} alarmTexts={alarmTexts} /> */}
      <ListItem
        secondaryAction={
          <>
            <span id="alarm-time">{alarmTimes}</span>
            <IconButton edge="end" onClick={() => readAlarm(index)}>
              {isRead ? null : <CloseIcon />}
            </IconButton>
          </>
        }
      >
        <ListItemAvatar>
          {isRead ? <TaskAltIcon /> : <RadioButtonUncheckedIcon />}
        </ListItemAvatar>
        <ListItemText primary="{alarmTypes}" secondary="{alarmTexts}" />
      </ListItem>
    </div>
  );
};

export default AlarmItem;
